import Home from "./Componants/Home";
import Navbar from "./Componants/Navbar/Navbar";
import NewRecipe from "./Componants/NewRecipe/NewRecipe";
import { BrowserRouter as Router, Route, Switch, Routes } from "react-router-dom/cjs/react-router-dom.min";

const App = () => {
  return (
    <Router>
      <div className="app container mx-auto">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/D" element={<NewRecipe />} />
        </Routes>
      </div>
    </Router>
  );
};
export default App;
